import React from 'react';
import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Navbar.css';

export default class Navbar extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            navbarOpen: false
        };
    }

    toggleNavbar = () => {
        this.setState({ navbarOpen: !this.state.navbarOpen });
    }

    render() {
        const navbarClasses = this.state.navbarOpen ? 'collapse navbar-collapse show' : 'collapse navbar-collapse';

    return (
<nav class="navbar navbar-expand-md navbar-dark bg-dark">
  <div class="container">
    <a class="navbar-brand" href="#">
      <img src="./img/SSU.png" alt="Logo SSU" style="width: 75px; height: 75px;" />
    </a>
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent"
      aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarSupportedContent">
      <ul class="navbar-nav ml-auto">
        <li class="nav-item">
          <a class="nav-link" href="#"><i class="bi bi-house"></i> Inicio</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="/nosotros"><i class="bi bi-person"></i> Sobre nosotros</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="/jugadores"><i class="bi bi-person-badge-fill"></i> Nuestros jugadores</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="/contacto"><i class="bi bi-images"></i> Contacto</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="/otros"><i class="bi bi-controller"></i> Â¿Quieres conocer otros juegos?</a>
        </li>
      </ul>
    </div>
  </div>
</nav>

        );
    }
}
